import Grid from './elements/Grid';
import Spinner from './elements/Spinner';

import {useMovieFetch} from './hooks/useMovieFetch';
const Movie=({movieId})=> {
    const[movie,loading,error]=useMovieFetch(movieId);
    return(
        <React.Fragment>
            {console.log(movie)}
            <Navigation/>
            <MovieInfo/>
            <MovieInfoBar/>
            <Grid>
                <Actor/>
            </Grid>
            <Spinner/>

        </React.Fragment>
    )
};

export default Movie;
